(9, 1, 'The Tunnel to Summer, the Exit of Goodbyes', 'Drama, Mystery, Romance, Sci-Fi', 'Tomohisa Taguchi', 'Ouji Suzuka, Marie Iitoyo, Tasuku Hatanaka, Arisa Komiya', 'Kaoru Touno\'s family is falling apart. After the death of a sibling and his parents\' divorce, he no longer feels any peace at home. Following a heated confrontation with his father, Kaoru runs out of his house and finds himself before a mysterious tunnel, which pulls him in. Bewildered by what he sees inside, he rushes to the exit, picking up a bird that looks identical to his deceased pet on his way out.\r\n\r\nUpon emerging outside, Kaoru realizes that, despite him spending just a few minutes inside the tunnel, an entire week has passed. The bizarre experience leads him to remember the rumors of \"Urashima Tunnel\"a passage that grants wishes in exchange for one\'s lifespan. Given the resurrection of his pet bird, Kaoru cannot help but wonder if another visit can help fix his messed up life.\r\n\r\nHowever, when he returns to the entrance of the mysterious tunnel, Kaoru realizes that he has been followed by Anzu Hanashiro, a new transfer student in his class. She also knows about the rumors and asks him to help her with an experimentit turns out that she, too, has a wish that only the tunnel can grant.', 83, '2024-06-13', , 'https://www.youtube.com/watch?v=29KybHTiCqc');
