INSERT INTO `movie` (`movie_id`, `status`, `title`, `genre`, `director`, `cast`, `synopsis`, `duration`, `release_date`, `poster_path`, `trailers_path`) VALUES
(11, 2, 'Puss in Boots: The Last Wish', 'Comedy, Musical, Adventure, Fantasy, Drama', 'Joel Crawford', 'Antonio Banderas, Salma Hayek Pinault, Harvey Guilln, Florence Pugh, Olivia Colman', 'Puss in Boots discovers that his passion for adventure has taken its toll when he learns that he has burnt through eight of his nine lives. Puss sets out on an epic journey to find the mythical Last Wish and restore his nine lives.', 102, '2024-08-30', , 'https://www.youtube.com/watch?v=RqrXhwS33yc');
INSERT INTO `movie` (`movie_id`, `status`, `title`, `genre`, `director`, `cast`, `synopsis`, `duration`, `release_date`, `poster_path`, `trailers_path`) VALUES
(12, 2, 'Made in Abyss: Dawn of the Deep Soul', 'Adventure, Drama, Fantasy, Mystery, Sci-Fi', 'Masayuki Kojima', 'Shiori Izawa, Ise Mariya, Miyu Tomita, Toshiyuki Morikawa, Sayaka Ohara', 'After bonding over a tragic loss, the long-suffering Nanachi joins Riko and Reg on their journey into the depths of the Abyss. Awaiting the children is the Sea of Corpsesthe Abyss\'s fifth layer, and the deepest level from which a traveler can return without losing their human form.\r\n\r\nThe masked sadist Bondrewd stands between the children and the rest of their adventure. Bondrewd\'s horrific laboratory serves as a final checkpoint for those wishing to traverse deeper into the Abyss, and the sociopathic scientist has no desire to allow Riko\'s party to pass through at no cost. Deeply scarred by Bondrewd\'s impact on their childhood, Nanachi is engulfed in turmoil over his resurgence in their life.\r\n\r\nBondrewd\'s only apparent weakness is Prushka, a brash child who claims to be his daughter. Riko, Reg, and Nanachi befriend Prushka and work with the girl to overcome her father\'s machinations and breach the Abyss\'s sixth layer.\r\n', 105, '2024-07-21', , 'https://www.youtube.com/watch?v=NNwD_Hx1GHY');

